import React from 'react';
import { BrowserRouter as Router, Route, NavLink } from 'react-router-dom';
import AllTodosIds from './component/AllTodosIds';
import AllTodosIdsAndTitles from './component/AllTodosIdsAndTitles';
import UnresolvedTodos from './component/UnresolvedTodos';
import ResolvedTodos from './component/ResolvedTodos';
import AllTodosIdsAndUserIds from './component/AllTodosIdsAndUserIds';
import ResolvedTodosWithUserIds from './component/ResolvedTodosWithUserIds';
import UnresolvedTodosWithUserIds from './component/UnresolvedTodosWithUserIds';
import './App.css';

const App = () => {
  return (
    <Router>
      <nav className="navbar navbar-expand-lg bg-body-tertiary">
        <div className="container-fluid">
          <a className="navbar-brand" href="#">NFL Todos</a>
          <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav" aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span className="navbar-toggler-icon"></span>
          </button>
          <div className="collapse navbar-collapse" id="navbarNav">
            <ul className="navbar-nav">
              <li className="nav-item">
                <NavLink exact to="/" className="nav-link" activeClassName="active">Home</NavLink>
              </li>
              <li className="nav-item">
                <NavLink to="/features" className="nav-link" activeClassName="active">Features</NavLink>
              </li>
              <li className="nav-item">
                <NavLink to="/pricing" className="nav-link" activeClassName="active">Pricing</NavLink>
              </li>
              <li className="nav-item">
                <NavLink to="/disabled" className="nav-link disabled" aria-disabled="true">Disabled</NavLink>
              </li>
            </ul>
          </div>
        </div>
      </nav>
      <div className="container mt-4">
        <Route exact path="/" component={AllTodosIds} />
        <Route path="/todos-titles" component={AllTodosIdsAndTitles} />
        <Route path="/unresolved-todos" component={UnresolvedTodos} />
        <Route path="/resolved-todos" component={ResolvedTodos} />
        <Route path="/todos-userids" component={AllTodosIdsAndUserIds} />
        <Route path="/resolved-todos-userids" component={ResolvedTodosWithUserIds} />
        <Route path="/unresolved-todos-userids" component={UnresolvedTodosWithUserIds} />
      </div>
    </Router>
  );
};

export default App;
